import { createSelector } from 'reselect';

export const projectGallerySelector = state => state.projectGallery

export const projectsFound = createSelector(
  projectGallerySelector,
  projectGallery => projectGallery.projectsFound
)

export const currentSelectedProject = createSelector(
  projectGallerySelector,
  projectGallery => projectGallery.project
)
